import React from 'react';
import DynamicFieldsForm from "../../../common/DynamicFieldsForm";
import {Button, Tabs,Divider,Table,Card , Icon ,Radio} from "antd";
const TabPane = Tabs.TabPane;
class Printout extends React.Component{
	constructor(props){
		super(props);
		const panes = [
	      { title: 'Tab 1', content: 'Content of Tab 1', key: '1' },
	      { title: 'Tab 2', content: 'Content of Tab 2', key: '2' },
	      {
	        title: 'Tab 3', content: 'Content of Tab 3', key: '3', closable: false,
	      },

	    ];
	    this.state = {
	      activeKey: panes[0].key,
	      panes,
	    };

	}


	render(){
		return (<div>
	            <Tabs defaultActiveKey="emr">
	              <TabPane tab={<span><Icon type="calculator" />EMR</span>} key="emr">
	              	<Card>
		              	<h4>
	                        <div>
	                        	<Tabs>
								    <TabPane tab="Tab 1" key="1">{this.panes.content}</TabPane>
								    <TabPane tab="Tab 2" key="2">Treatment Plan</TabPane>
								    <TabPane tab="Tab 3" key="3">Case Sheet</TabPane>
								    <TabPane tab="Tab 4" key="3">Medical Leave</TabPane>
								    <TabPane tab="Tab 5" key="3">Vital Signs</TabPane>
								    <TabPane tab="Tab 6" key="3">Lab Order</TabPane>
								    <TabPane tab="Tab 7" key="3">Lab Order Result</TabPane>
								</Tabs>

	                        	<Radio.Group defaultValue="a" buttonStyle="solid">
							        <Radio.Button value="a">Prescription</Radio.Button>
							        <Radio.Button value="b">Treatment Plan</Radio.Button>
							        <Radio.Button value="c">Case Sheet</Radio.Button>
							        <Radio.Button value="d">Medical Leave</Radio.Button>
							        <Radio.Button value="e">Vital Signs</Radio.Button>
							        <Radio.Button value="f">Lab Order</Radio.Button>
							        <Radio.Button value="g">Lab Order Result</Radio.Button>
							    </Radio.Group>

	                        </div>
	                    </h4>


	             	</Card>
	              </TabPane>
	              <TabPane tab={<span><Icon type="book" />BILLING</span>} key="billing">
	              <Card>
		               	<h4>
	                        <div>
	                            <Radio.Group defaultValue="a" buttonStyle="solid">
							        <Radio.Button value="a">Invoices</Radio.Button>
							        <Radio.Button value="b">Receipts</Radio.Button>
							    </Radio.Group>
	                        </div>
	                    </h4>
	                     	</Card>
	              </TabPane> 
	            </Tabs>
		</div>);

	}

}
export default Printout;
